import { useNavigation } from '@react-navigation/native'

const HomeScreen = () => {

  return (
    <View>
      <Text>
        Hi
      </Text>
    </View>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    
  },

  optionContainer: {
    width: '50%',
    height: '40%',
    alignItems: "center",
    justifyContent: 'space-evenly',
    backgroundColor: '#FFEDDD',
    borderColor: '#401f02',
    borderWidth: 1,
    borderRadius: 15
  }
});

